const Modal = ({ isOpen, closeModal }) => {
  if (!isOpen) {
    return null;
  }

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <h1>this is model</h1>
        <button onClick={closeModal}>Close</button>
      </div>
    </div>
  );
};

export default Modal;
